

var testImage = 'data:image/jpeg;base64,';

$(document).ready(function () {

    //draw test image
    var image = new Image();
    image.src = testImage;

    var inC = $('#inCanvas')[0];
    inC.width = image.width;
    inC.height = image.height;

    var inCctx = inC.getContext('2d');
    inCctx.drawImage(image,0,0);

    //initialize divPixel
    convertToDivPixel();


    $('#convertButton').on('click',function(){

        var hA = JSON.parse($('#hc').html());

        for(var i = 0; i < hA.length; i++){
            var hex = hA[i];
            var pixelCellTemp = '';
            if(hex === 'b'){
                pixelCellTemp = "<div style='clear:both;'></div>";
            }
            else if(IsInteger(hex)){
                var temp = hA[hex];
                pixelCellTemp = "<div style='width: 1px;height: 1px;padding: 0px;margin: 0px;border: 0px;float: left;display: block;background: ##hex##'></div>".replace('##hex##',temp);
            }
            else{
                pixelCellTemp = "<div style='width: 1px;height: 1px;padding: 0px;margin: 0px;border: 0px;float: left;display: block;background: ##hex##'></div>".replace('##hex##',hex);
            }


            $('#outBox').append(pixelCellTemp);
        }

    });


   function convertToDivPixel(){
       var hArr = [];
       var hArrC = [];

       var c = $('#inCanvas')[0];
       var ctx = c.getContext('2d');
       var pixels = ctx.getImageData(0,0, c.width, c.height).data;

       for(var i = 0; i< pixels.length; i+=4){
           var hex =  '#' + rbgToHex(pixels[i],pixels[i+1],pixels[i+2]);

           hArr.push(hex);

           var hIdx = hArrC.indexOf(hex);

           if(hIdx !== -1){
                hArrC.push(hIdx);
           }
           else{
               hArrC.push(hex)
           }

           if((i/4)%c.width ===0){
               //$('#outBox').append("<div style='clear:both;'></div>");
               hArr.push('b');
               hArrC.push('b');
           }

       }

       $('#hc').html(JSON.stringify(hArrC));

   }



   function rbgToHex(r, g, b){
       function cToHex(c){
           var hex = c.toString(16);
           return hex.length == 1 ? "0" + hex : hex;
       }

       return cToHex(r) + cToHex(g) + cToHex(b);

   }

   function sortHexColor(hArr,w){
        var outHArr = new Array(hArr.length);
   }

    function IsInteger(i){
        var intRegex = /^\d+$/;
        if(intRegex.test(i)){
            return true;
        }

        return false;

    }

});